import React from 'react';

function ReportCard({ report }) {
  return (
    <div className="report-card">
      <h2>{report.name} ({report.pan})</h2>
      <p>Phone: {report.phone}</p>
      <p>Credit Score: {report.creditScore}</p>
      <h3>Summary</h3>
      <ul>
        <li>Total Accounts: {report.totalAccounts}</li>
        <li>Active: {report.activeAccounts}</li>
        <li>Closed: {report.closedAccounts}</li>
        <li>Current Balance: ₹{report.currentBalance}</li>
        <li>Secured: ₹{report.securedBalance}</li>
        <li>Unsecured: ₹{report.unsecuredBalance}</li>
        <li>Recent Enquiries: {report.recentEnquiries}</li>
      </ul>
      <h3>Accounts</h3>
      {report.accounts.map((acc, i) => (
        <div key={i} className="account-entry">
          <p><strong>{acc.type}</strong> - {acc.bank}</p>
          <p>Account #: {acc.accountNumber}</p>
          <p>Balance: ₹{acc.currentBalance}, Overdue: ₹{acc.amountOverdue}</p>
          <p>Address: {acc.address}</p>
        </div>
      ))}
    </div>
  );
}

export default ReportCard;
